import{_ as e,o as t,c as a,O as r}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 19.2-386.25 Judge may order law-enforcement agency to maintain custody of controlled substances, etc.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/19.2-386.25.md","filePath":"vacode/19.2-386.25.md"}'),o={name:"vacode/19.2-386.25.md"},n=r('<h1 id="§-19-2-386-25-judge-may-order-law-enforcement-agency-to-maintain-custody-of-controlled-substances-etc" tabindex="-1">§ 19.2-386.25 Judge may order law-enforcement agency to maintain custody of controlled substances, etc. <a class="header-anchor" href="#§-19-2-386-25-judge-may-order-law-enforcement-agency-to-maintain-custody-of-controlled-substances-etc" aria-label="Permalink to &quot;§ 19.2-386.25 Judge may order law-enforcement agency to maintain custody of controlled substances, etc.&quot;">​</a></h1><p>Upon request of the clerk of any court, a judge of the court may order a law-enforcement agency to take into its custody or to maintain custody of substantial quantities of any controlled substances, imitation controlled substances, chemicals, marijuana, or paraphernalia used or to be used in a criminal prosecution under Chapter 7 (§ <a href="http://law.lis.virginia.gov/vacode/18.2-247/" target="_blank" rel="noreferrer">18.2-247</a> et seq.) of Title 18.2. The court in its order may make provision for ensuring integrity of these items until further order of the court.</p><p>1985, c. 377, § 18.2-253.2; 2004, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?041+ful+CHAP0995" target="_blank" rel="noreferrer">995</a>; 2011, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?111+ful+CHAP0384" target="_blank" rel="noreferrer">384</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?111+ful+CHAP0410" target="_blank" rel="noreferrer">410</a>; 2014, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?141+ful+CHAP0674" target="_blank" rel="noreferrer">674</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?141+ful+CHAP0719" target="_blank" rel="noreferrer">719</a>.</p>',3),i=[n];function c(s,l,d,f,u,g){return t(),a("div",null,i)}const h=e(o,[["render",c]]);export{m as __pageData,h as default};
